"<div>\n<i class=\"NoteType\">\nDo zrobienia\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKonieczne jest przejrzenie dzieci poniewa\u017c pochodz\u0105 od Wojciecha Dzieniszewskiego i Rozalii.<br />\nAlbo s\u0105  3 Rozalie, albo jedn\u0105 nazywa si\u0119 r\u00f3\u017cnymi nazwiskami<br />\n- Domalewska<br />\n- O\u017carowska/U\u017carowska<br />\n- Piotrowska<br />\n- Przychodzie\u0144.\n</p>\n<p>\nDo weryfikacji dok\u0142adnej akt dzieci (UR/MA/ZG) pod k\u0105tem:<br />\n-  dok\u0142adnych dat urodze\u0144, tak \u017ceby ewentualnie wykluczy\u0107 si\u0119 nak\u0142adaj\u0105ce si\u0119 ci\u0105\u017ce (oczywiste jest, \u017ce mog\u0142y by\u0107 do\u015b\u0107 kr\u00f3tkie ci\u0105\u017ce, ale w tamtych latach ci\u0119\u017cko oczekiwa\u0107, \u017ce dziecko poni\u017cej 7 miesi\u0105ca prze\u017cy\u0142o).<br />\n- wieku ojca<br />\n- wieku \"r\u00f3\u017cnych\" Rozalii, oraz to czy s\u0105 okre\u015blone jako ma\u0142\u017conki\n</p>\n<p>\nIstnieje wiele opcji rozwi\u0105zania tego problemu, bo w zasadzei Rozalii mo\u017ce by\u0107 1, 2, 3 albo cztery. Ka\u017cda opcja do zbadanie.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
