"<div>\n<i class=\"NoteType\">\nNotatka rodzinna\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"Owdowia\u0142a  w 1868 roku po zmar\u0142ym m\u0119\u017cu Adamie Miko\u0142ajcziku, kt\u00f3ry by\u0142 szeregowym dwudziestego pierwszego batalionu strzelc\u00f3w Imperium, na podstawie wdowiego za\u015bwiadczenia, wydanego przez Pana Lom\u017cy\u0144skiego Gubernatora Naczelnika Wojskowego  w 1869 roku, pod numerem 3501, jako c\u00f3rka zmar\u0142ych rodzic\u00f3w Wojciecha i jego \u017cony Katarzyny urodzonej Ferenz pa\u0144stwa Sobiewkich urodzona w Ma\u0142kini\"\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n\"\u041e\u0432\u0434\u043e\u0432\u0435\u043b\u0430 \u043f\u043e \u0443\u043c\u0435\u0440\u0448\u0435\u043c\u0443 \u043c\u0443\u0436\u0443 \u0410\u0434\u0430\u043c\u0443 \u041c\u0438\u043a\u043e\u043b\u0430\u0439\u0447\u0438\u043a\u0443, \u0440\u044f\u0434\u043e\u0432\u043e\u043c\u0443 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044c \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0446\u0443\u0433\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0431\u0430\u0442\u0430\u043b\u044c\u043e\u043d\u0430 \u0432 \u0418\u043c\u043f\u0435\u0440\u0438\u0438 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u0432\u0434\u043e\u0432\u044c\u0435\u0433\u043e \u0432\u0438\u0434\u0430, \u0432\u044b\u0434\u0430\u043d\u043d\u043e\u0433\u043e \u0433\u043e\u0441\u043f\u043e\u0434\u0438\u043d\u043e\u043c \u041b\u043e\u043c\u0436\u0443\u043d\u0441\u043a\u0438\u043c \u0433\u0443\u0431\u0435\u0440\u043d\u0441\u043a\u0438\u043c \u0432\u043e\u0438\u043d\u0441\u043a\u0438\u043c \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u043e\u043c \u0432 1869 \u0433\u043e\u0434\u0443 \u0437\u0430 \u043d\u043e\u043c\u0435\u0440\u043e\u043c \u0442\u0440\u0438 \u0442\u044b\u0441\u044f\u0447\u0430 \u043f\u044f\u0442\u044c\u0441\u043e\u0442 \u043e\u0434\u0438\u043d \u0432 1868 \u0433\u043e\u0434\u0443, \u0434\u043e\u0447\u0435\u0440\u044c\u044e \u043f\u043e\u043a\u043e\u0439\u043d\u044b\u0445 \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u0435\u0439 \u0411\u043e\u0439\u0446\u0435\u0445\u0430 \u0438 \u0435\u0433\u043e \u0441\u0443\u043f\u0440\u0443\u0433\u0438 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b, \u0440\u043e\u0436\u0434\u0435\u043d\u043d\u043e\u0439 \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u043e\u0432\u0435.\"\n</p>\n</div>\n</div>",
